// src/components/common/Navbar.jsx
import React, { useState } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../../hooks/useAuth';
import { Menu, Package, User, LogOut, Bell, Search } from 'lucide-react';

const Navbar = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();
  const [trackingNumber, setTrackingNumber] = useState('');

  const handleTrackingSubmit = (e) => {
    e.preventDefault();
    if (trackingNumber) {
      navigate(`/tracking/${trackingNumber}`);
      setTrackingNumber('');
    }
  };

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  const isAdminRoute = location.pathname.startsWith('/admin');

  return (
    <nav className="fixed top-0 left-0 right-0 bg-white border-b border-gray-200 z-40">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between h-16">
          {/* Left section */}
          <div className="flex items-center">
            <Link to="/" className="flex items-center">
              <Package className="h-8 w-8 text-blue-600" />
              <span className="ml-2 text-xl font-bold text-gray-900">
                FastCourier
              </span>
            </Link>
          </div>

          {/* Center section - Quick tracking (only show on non-admin routes) */}
          {!isAdminRoute && (
            <div className="flex-1 max-w-lg mx-4 hidden md:block">
              <form onSubmit={handleTrackingSubmit} className="relative">
                <input
                  type="text"
                  placeholder="Track your shipment"
                  value={trackingNumber}
                  onChange={(e) => setTrackingNumber(e.target.value)}
                  className="w-full px-4 py-2 pl-10 pr-4 rounded-md border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                />
                <Search className="absolute left-3 top-2.5 h-5 w-5 text-gray-400" />
                <button
                  type="submit"
                  className="absolute right-2 top-2 px-3 py-1 bg-blue-600 text-white rounded-md text-sm"
                >
                  Track
                </button>
              </form>
            </div>
          )}

          {/* Right section */}
          <div className="flex items-center gap-4">
            {user ? (
              <>
                {!isAdminRoute && (
                  <Link
                    to="/create-courier"
                    className="hidden md:inline-flex items-center px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700"
                  >
                    New Shipment
                  </Link>
                )}

                <div className="flex items-center gap-3">
                  <div className="relative">
                    <Link to="/notifications">
                      <Bell className="h-6 w-6 text-gray-500 hover:text-gray-700" />
                      {user.unreadNotifications > 0 && (
                        <span className="absolute -top-1 -right-1 h-4 w-4 bg-red-500 rounded-full flex items-center justify-center text-xs text-white">
                          {user.unreadNotifications}
                        </span>
                      )}
                    </Link>
                  </div>

                  <div className="flex items-center gap-2">
                    <Link to="/profile" className="flex items-center">
                      {user.profile_image ? (
                        <img
                          src={`http://localhost:5000/uploads/${user.profile_image}`}
                          alt="Profile"
                          className="h-8 w-8 rounded-full object-cover"
                        />
                      ) : (
                        <User className="h-8 w-8 text-gray-500 p-1 bg-gray-100 rounded-full" />
                      )}
                      <span className="ml-2 text-sm font-medium text-gray-700 hidden md:block">
                        {user.name}
                      </span>
                    </Link>

                    <button
                      onClick={handleLogout}
                      className="p-2 text-gray-500 hover:text-gray-700"
                      title="Logout"
                    >
                      <LogOut className="h-5 w-5" />
                    </button>
                  </div>
                </div>
              </>
            ) : (
              <div className="flex items-center gap-4">
                <Link
                  to="/login"
                  className="text-gray-600 hover:text-gray-900 font-medium"
                >
                  Login
                </Link>
                <Link
                  to="/register"
                  className="inline-flex items-center px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700"
                >
                  Register
                </Link>
              </div>
            )}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
